DROP TABLE IF EXISTS `t_sys_message`;
CREATE TABLE `t_sys_message` (
  `id_` varchar(50) DEFAULT NULL,
  `user_id` varchar(50) DEFAULT NULL COMMENT '提醒用户',
  `msg_type` varchar(50) DEFAULT NULL COMMENT '消息类型',
  `read` varchar(2) DEFAULT '0' COMMENT '是否已读',
  `msg_content` varchar(200) DEFAULT NULL COMMENT '消息内容',
  `created_date` timestamp NULL DEFAULT NULL COMMENT '创建日期'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统消息表';

-- ----------------------------
--  Records of `t_sys_message`
-- ----------------------------
BEGIN;
INSERT INTO `t_sys_message` VALUES ('1', '1', 'm1\r\n', '0', '深入研究珠宝/饰品行业特性，了解用户需求；了解珠宝/饰品行业卖家的货品特征、供应链等状况及问题；', '2014-10-21 23:51:32'), ('2', '1', 'm1', '0', '负责黄金饰品行业运营，了解市场，买家需求，通过网站和无线端运营，确定目标、分解计划、落地实现、整合内外资源，拿得结果；', '2014-10-21 23:52:16'), ('3', '1', 'm1', '0', '制定或优化运营方案，制定运营规则，通过平台化、产品化、数据化、移动数据化方式推进运营目标实现', '2014-10-21 23:52:16'), ('4', '1', 'm1', '0', '2年以上珠宝/饰品行业从业经验，有2年以上电商从业经验的优先考虑；大学本科以上学历；', '2014-10-21 23:52:16'), ('6', '1', 'm1', '0', '访问群体遍布高校、行政机关和企事业单位，每日更新文章和资源 2000 余篇，日均发帖一万左右。拥有国内经济类教育网站最多的关注人数。', '2014-10-21 23:52:16'), ('7', '1', 'm1', '0', '访问群体遍布高校、行政机关和企事业单位，每日更新文章和资源 2000 余篇，日均发帖一万左右。拥有国内经济类教育网站最多的关注人数。', '2014-10-21 23:52:16'), ('8', '1', 'm1', '0', '网站提供各类数据共 10000多个，包括国内外各种年鉴、调查数据、自整理数据、行业分析报告等。', '2014-10-21 23:52:16'), ('5', '1', 'm1', '0', '学习能力强，善于创新，有不错的抗压能力；4、诚邀有想法、有要性、有执行力的珠宝电商团队加盟共创。', '2014-10-21 23:52:16');
COMMIT;

-- ----------------------------
--  Table structure for `t_sys_notice`
