DROP TABLE IF EXISTS `t_sys_notice`;
CREATE TABLE `t_sys_notice` (
  `id_` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `content` text COLLATE utf8_unicode_ci NOT NULL COMMENT '内容',
  `appendix_path` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '附件地址',
  `appendix_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '附件名称',
  `created_date` timestamp NULL DEFAULT NULL COMMENT '创建日期',
  `user_id` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `title` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '标题',
  `updated_date` timestamp NULL DEFAULT NULL COMMENT '修改日期',
  `type` varchar(2) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '公告类型',
  PRIMARY KEY (`id_`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
--  Records of `t_sys_notice`
-- ----------------------------
BEGIN;
INSERT INTO `t_sys_notice` VALUES ('4028b88149359945014935acb1240003', '<font face=\"tahoma, arial, verdana, sans-serif\">开通</font>', null, '', '2014-10-22 10:25:50', '1', '开通开通开通开通开通开通开通开通开通开通开通开通开通开通开通开通', null, null), ('4028b88149359945014935ad06090004', '<span style=\"font-family: \'Segoe UI\', Arial, \'Microsoft Yahei\', Simsun, sans-serif; line-height: 18px;\">在您关闭</span><strong style=\"font-family: \'Segoe UI\', Arial, \'Microsoft Yahei\', Simsun, sans-serif; line-height: 18px;\">所有</strong><span style=\"font-family: \'Segoe UI\', Arial, \'Microsoft Yahei\', Simsun, sans-serif; line-height: 18px;\">隐身标签页后，您在这些标签页中浏览的网页不会在浏览器历史记录、Cookie存储区或搜索记录中留下任何痕迹</span>', null, '', '2014-10-22 10:26:12', '1', '在您关闭所有隐身标签页后，您在这些标签页中浏览的网页不会在浏览器历史记录、Cookie存储区或搜索记录中留下任何痕迹', null, null), ('4028b88149359945014935ad2d2e0005', '<strong i18n-content=\"incognitoTabWarning\" style=\"font-family: \'Segoe UI\', Arial, \'Microsoft Yahei\', Simsun, sans-serif; line-height: 18px;\">即使您进入隐身模式，您的雇主、互联网服务提供商和您访问的网站仍然能看到您的浏览活动</strong>', null, '', '2014-10-22 10:26:22', '1', '即使您进入隐身模式，您的雇主、互联网服务提供商和您访问的网站仍然能看到您的浏览活动', null, null), ('4028b88149359945014935ad53f90006', '<span style=\"font-family: \'Segoe UI\', Arial, \'Microsoft Yahei\', Simsun, sans-serif; line-height: 18px;\">Cookie存储区或搜索记录中留下任何痕迹。不过，您下载的所有文件或创建的书签均会保留下来</span>', null, '', '2014-10-22 10:26:32', '1', 'Cookie存储区或搜索记录中留下任何痕迹。不过，您下载的所有文件或创建的书签均会保留下来', null, null), ('4028b88149359945014935add41e0007', '<span style=\"font-family: Tahoma, Verdana, Helvetica, sans-serif;\">启用配置编辑。将来在修改, 添加或删除此域中的项目时, 将自动激活这些更改。</span>', null, '', '2014-10-22 10:27:04', '1', '启用配置编辑。将来在修改, 添加或删除此域中的项目时, 将自动激活这些更改。', null, null), ('4028b88149359945014935ae110e0008', '<span style=\"font-family: Tahoma, Verdana, Helvetica, sans-serif;\">服务器是 WebLogic Server 的实例, 它运行在自己的 Java 虚拟机 (JVM) 上, 并具有自己的配置。</span>', null, '', '2014-10-22 10:27:20', '1', '服务器是 WebLogic Server 的实例, 它运行在自己的 Java 虚拟机 (JVM) 上, 并具有自己的配置。', null, null), ('4028b88149359945014935ae36a10009', '<span style=\"font-family: Tahoma, Verdana, Helvetica, sans-serif;\">此页概括了已在当前 WebLogic Server 域中配置的每一个服务器。</span>', null, '', '2014-10-22 10:27:30', '1', '此页概括了已在当前 WebLogic Server 域中配置的每一个服务器。', null, null), ('4028b88149359945014935ae6de6000a', '<span style=\"font-family: Tahoma, Verdana, Helvetica, sans-serif;\">在此页中, 您可以定制表中显示的列, 新建可迁移目标以及删除可迁移目标。可迁移目标是这样一种目标:</span>', null, '', '2014-10-22 10:27:44', '1', '在此页中, 您可以定制表中显示的列, 新建可迁移目标以及删除可迁移目标。可迁移目标是这样一种目标:', null, null), ('4028b88149359945014935aea868000b', '<span style=\"font-family: Tahoma, Verdana, Helvetica, sans-serif;\">Coherence 提供了复制和分布式数据管理和高速缓存服务，使用这些服务，可以可靠地使应用程序对象和数据可供 Coherence 集群中的所有服务器使用</span>', null, '', '2014-10-22 10:27:59', '1', 'Coherence 提供了复制和分布式数据管理和高速缓存服务，使用这些服务，可以可靠地使应用程序对象和数据可供 Coherence 集群中的所有服务器使用', null, null), ('4028b8814945312a014945434c280002', '<p style=\"margin: 0px 0px 1.5em; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 24px;\">深圳站依旧秉承“演讲从实践出发、听众从中受益”的原则，在保持北京站特色之余，针对微信开发的新情况重新设置了议程，内容源于实践又富于启发性。<b>正进行微信开发的开发团队（开发者）、有兴趣或即将投身于微信开发的开发者、想开发相关微信应用正努力寻找微信开发团队的传统IT企业，该会将是你不容错过的学习借鉴成功研发经验、寻找合作的大好机会。</b>如果你还在犹豫，可以仔细阅读一下主办方总结的技术团队不应错过2014年微信开发者大会深圳站的十个理由。</p><p style=\"margin: 0px 0px 1.5em; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 24px;\"><b>一、专注于“微信技术开发”，拒绝空谈理论。</b>与案例相结合，力求将内容讲透。<b>深圳站延续了北京站的办会风格，拒绝泛谈趋势、介绍自己产品功能或者微信营销等内容。比如本次大会继续邀请微信官方推荐的招商银行信用卡服务号开发商深圳云软联合创始人兼技术副总裁黄榕振，请他以招商服务号为例，深入解析微信公众帐号企业应用高级开发经验</b>，内容包括企业应用微信公众帐号开发的几个关键阶段、细谈CRM绑定、分离式CRM、交互设计的核心、系统安全性的几个问题、功能设计与用户痛点、某银行功能使用频度分析、多客服高级应用、分层次的软件架构设计、高性能和高可用设计、多公众号分权分域管理、分组群发高级应用几个主题展开深入演讲。</p><p style=\"margin: 0px 0px 1.5em; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 24px;\">以技术人群（含产品经理）为目标参会人群，<b>每位讲师的演讲时间长达60分钟，除技术演讲外，还预留出充分的提问时间</b>，保证参会者与嘉宾有更深入的交流。主办方鼓励与会者带着疑问来参会，带着解决方案离场，有搞不懂的疑问，欢迎参会者“抓住”讲师问个究竟。</p><p style=\"margin: 0px 0px 1.5em; padding: 0px; list-style: none; color: rgb(51, 51, 51); font-family: Helvetica, Tahoma, Arial, sans-serif; font-size: 14px; line-height: 24px;\"><br></p>', 'e:/ipefiles/notice/报表查询.~sql', '报表查询.~sql', '2014-10-25 11:04:38', '1', '错过就要等一年 深圳微信开发者大会不容错过的十大理由', null, null);
COMMIT;

-- ----------------------------
--  Table structure for `t_sys_remind`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_remind`;
CREATE TABLE `t_sys_remind` (
  `id_` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `rtitle` varchar(200) COLLATE utf8_unicode_ci NOT NULL COMMENT '提醒标题',
  `rcontent` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '提醒内容',
  `rtype` varchar(2) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '提醒类型',
  `created_date` datetime DEFAULT NULL COMMENT '创建时间',
  `remind_stdate` datetime DEFAULT NULL COMMENT '提醒开始时间',
  `remind_endate` datetime DEFAULT NULL COMMENT '提醒结束日期',
  PRIMARY KEY (`id_`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

